import React from "react";
import { energyHero } from "../../constants";

const Energy = () => {
  return (
    <section className="h-screen">
      <div className="size-full absolute flex-centralizer">
        <h1>Choose one Product</h1>
      </div>
      <div className="flex">
        {energyHero.map((item) => {
          return (
            <div className="md:w-1/2">
              <img src={item.link} alt={item.title} className="bg-fullobject" />
              <div className="size-full absolute">
                <h2>{item.title}</h2>
              </div>
            </div>
          );
        })}
      </div>
    </section>
  );
};

export default Energy;
